export default function user(state ={user:{}, token:{}, msg:''}, action) {
    switch(action.type) {
        case "isRegister": {
            state = {...state, user:action.payload}
            state = {...state , token:action.payload.msg}
            break;
        }
        case 'isLogin': {
            state = {...state , token:action.payload}
            state = {...state , token:action.payload.msg}
            break;
        }
        default : {

        }
    }
    return state;
}
